import React, { Component } from 'react';

const api = 'https://api.nytimes.com/svc/mostpopular/v2/viewed/1.json?api-key=mN6Xg33Uh049lVc0uwErmOgdhb4TYBt4';


class Articles extends React.Component {

constructor (props) {
	super(props);
	this.state = {
		error: null,
		isLoaded: false,
		items: []
	}
}

componentDidMount(){
	fetch(api)
	.then(res => res.json())
	.then(
		(result) => {
			this.setState({
				isLoaded: true,
				items: result.results
			});
		}

		)
}

 render() {
const { error, isloaded, items } = this.state;
if(error) {
	return <div>Error: {error.message} </div>;
} else {
return (
        <ul>
          {items.map(item => (
            <li>
              {item.title[1]}
            </li>
          ))}
        </ul>
      );
    }
  }
}




